import axios from "axios";

function getAddChatFriend(user_id2) {
  return async () => {
    await axios
      .post(`/api/chat/save`, user_id2)
      .then((response) => {
        const data = response.data;
        console.log(data);
        alert("친구추가");

        return data;
      })

      .catch((error) => {
        console.log(error);
        alert("친구추가실패");
      });
  };
}

export const chatActions = {
  getAddChatFriend,
};
